/*Table structure for table `appointment_task` */

DROP TABLE IF EXISTS `appointment_task`;

CREATE TABLE `appointment_task` (
  `app_task_code` varchar(255) NOT NULL,
  `appointment_code` varchar(100) NOT NULL,
  `employee_id` varchar(100) NOT NULL,
  `date_assist` date DEFAULT NULL,
  `remark` varchar(50) NOT NULL,
  PRIMARY KEY (`app_task_code`,`appointment_code`,`employee_id`),
  KEY `appointment_code` (`appointment_code`),
  KEY `employee_id` (`employee_id`),
  CONSTRAINT `appointment_task_ibfk_1` FOREIGN KEY (`appointment_code`) REFERENCES `appointments` (`appointment_code`),
  CONSTRAINT `appointment_task_ibfk_2` FOREIGN KEY (`employee_id`) REFERENCES `employees` (`employee_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `appointment_task` */

LOCK TABLES `appointment_task` WRITE;

UNLOCK TABLES;

/*Table structure for table `appointments` */

DROP TABLE IF EXISTS `appointments`;

CREATE TABLE `appointments` (
  `appointment_code` varchar(255) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `first_name` varchar(50) NOT NULL,
  `middle_name` varchar(50) NOT NULL,
  `purpose` varchar(50) NOT NULL,
  `date_of_book` date NOT NULL,
  `status` varchar(50) NOT NULL,
  PRIMARY KEY (`appointment_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `appointments` */

LOCK TABLES `appointments` WRITE;

UNLOCK TABLES;

/*Table structure for table `assigned_task` */

DROP TABLE IF EXISTS `assigned_task`;

CREATE TABLE `assigned_task` (
  `task_code` varchar(100) NOT NULL,
  `request_gvcode` varchar(100) NOT NULL,
  `client_id` varchar(100) NOT NULL,
  `employee_id` varchar(100) NOT NULL,
  `type_of_request` char(20) NOT NULL,
  `object_file` longtext DEFAULT NULL,
  `remarks` char(20) NOT NULL,
  `date_start` date NOT NULL,
  `date_finish` date DEFAULT NULL,
  PRIMARY KEY (`task_code`,`request_gvcode`,`client_id`,`employee_id`),
  KEY `request_gvcode` (`request_gvcode`),
  KEY `employee_id` (`employee_id`),
  KEY `client_id` (`client_id`),
  CONSTRAINT `assigned_task_ibfk_1` FOREIGN KEY (`request_gvcode`) REFERENCES `request_gv` (`request_gvcode`),
  CONSTRAINT `assigned_task_ibfk_3` FOREIGN KEY (`employee_id`) REFERENCES `employees` (`employee_id`),
  CONSTRAINT `assigned_task_ibfk_4` FOREIGN KEY (`client_id`) REFERENCES `request_gv` (`request_gvcode`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `assigned_task` */

LOCK TABLES `assigned_task` WRITE;

UNLOCK TABLES;

/*Table structure for table `brands` */

DROP TABLE IF EXISTS `brands`;

CREATE TABLE `brands` (
  `brand_id` varchar(50) NOT NULL,
  `client_id` varchar(100) NOT NULL,
  `brand_name` varchar(50) NOT NULL,
  `brand_industry` varchar(50) NOT NULL,
  `brand_audience` varchar(50) NOT NULL,
  `web_address` varchar(255) NOT NULL,
  `color_scheme` longtext NOT NULL,
  `font` varchar(50) NOT NULL,
  `description` varchar(50) NOT NULL,
  `date_of_register` date NOT NULL,
  PRIMARY KEY (`brand_id`,`client_id`),
  KEY `client_id` (`client_id`),
  CONSTRAINT `brands_ibfk_1` FOREIGN KEY (`client_id`) REFERENCES `clients` (`client_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

