  `username` varchar(50) DEFAULT NULL,
  `password` varchar(255) DEFAULT NULL,
  `subscription` varchar(50) DEFAULT NULL,
  `account_status` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`client_id`)
